INSERT INTO `notices` VALUES (1,'zone','[공통] 글로벌 존/센터 오픈','<p>- 참가 대상 : 본교 한국인 재학생</p>\n<p>- 참여 방법 : 본교 글로벌 존/센터 온라인 예약 시스템 예약 후, 스마트 폰 or 노트북 ZOOM 어플리케이션 이용 활동 실시</p>\n<p>- 제공 혜택 : 11월 30일까지 글로벌 존/센터 이용 횟수를 글로벌 포인트로 반영(12월 초 글로벌 포인트 장학금 지급 예정)</p>\n<p>- 운영 기간</p>\n<p>&nbsp;&nbsp;*  글로벌 존 : 10월 5일 ~ 12월 4일</p>\n<p>&nbsp;&nbsp;* 글로벌 센터 : 10월 12일 ~ 12월 4일</p>\n<p>- 세부내용 : 첨부 문서 참조</p>',125,'2020-10-04 12:21:28','2020-10-05 11:08:13'),(4,'zone','[공통] 글로벌 존/센터 학생 메뉴얼','<p><a href=\"https://s3.us-west-2.amazonaws.com/secure.notion-static.com/5e653aec-b3be-4f78-b1d5-f6038f96f639/__.pdf?X-Amz-Algorithm=AWS4-HMAC-SHA256&X-Amz-Credential=AKIAT73L2G45O3KS52Y5%2F20201004%2Fus-west-2%2Fs3%2Faws4_request&X-Amz-Date=20201004T132349Z&X-Amz-Expires=86400&X-Amz-Signature=f3dbec00d0e13a69716fd0c0e4ee77654db25f47da6b3114dd6ddcff5ef2e990&X-Amz-SignedHeaders=host&response-content-disposition=filename%20%3D%22%25E1%2584%2580%25E1%2585%25B3%25E1%2586%25AF%25E1%2584%2585%25E1%2585%25A9%25E1%2584%2587%25E1%2585%25A5%25E1%2586%25AF%25E1%2584%258C%25E1%2585%25A9%25E1%2586%25AB%2520%25E1%2584%258C%25E1%2585%25A2%25E1%2584%2592%25E1%2585%25A1%25E1%2586%25A8%25E1%2584%2589%25E1%2585%25A2%25E1%2586%25BC%2520%25E1%2584%2586%25E1%2585%25A6%25E1%2584%2582%25E1%2585%25B2%25E1%2584%258B%25E1%2585%25A5%25E1%2586%25AF.pdf%22\" target=\"_blank\">글로벌 존/센터 학생 메뉴얼 [ 클릭 ]</a></p>',83,'2020-10-04 14:53:06','2020-10-05 11:08:19');
